script: |
  super -f text -I q9815.spq | sort > q9815.out

inputs:
  - name: q9815.spq
    data: |
      SELECT ALL * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( NULL <= ( - + col1 ) ) OR NOT ( + col1 + - + col0 * + col1 * - col1 + col2 ) NOT BETWEEN ( col2 ) AND + 15;
  - name: tab0

outputs:
  - name: q9815.out
    data: |
